There is more in the darkness than you know... Mind-full host Spencer Knights puts his crew in peril whilst trying to win his own series as part of the paranormal competition Dark Vision. Find out what manifestations lay in wait for his team inside Baylock's Folly - a place with a dark history and possibly a darker present. Who is it's mysterious caretaker Clem and what are the twisted motivations of the producers at the &quot;Dark Vision Hub&quot;? Step into the darkness and find the answers in this new wave gothic horror from Stray Spark productions.

Director: Darren Flaxstone
Writers: Darren Flaxstone, Bernie Hodges
Stars: Bernie Hodges, Suzie Latham, Judith Haley
Genres: Horror | Mystery | Sci-Fi
Country: UK
Language: English

